/* eslint-disable import/no-anonymous-default-export */
import {
  REGISTRO_EXITOSO,
  REGISTRO_ERROR,
  OBTENER_USUARIO,
  LOGIN_EXITOSO,
  LOGIN_ERROR,
  CERRAR_SESION
} from "../../types";

export default ( state, action ) => {
  switch ( action.payload ) {
    default:
      return state;
  }
}
